import 'bootstrap/dist/css/bootstrap.min.css';
import './signup.css'

const SignUp = () => {
    return (
        <div className='register'>
            <div>
                <input type='radio' name='role' value='Buyer'></input>
                <label>Buyer</label>
                <span className='mx-3'>
                    <input  type='radio' name='role' value='Seller'></input>
                    <input  type='radio' name='role' value='Seller'></input>
                    <label>Seller</label>
                </span>
            </div>
            <div className='form-floating'>
                <input className='form-control' placeholder='example@gmail.com'></input>
                <label for="floatingInput">Email address</label>
            </div>
            <div className="form-floating mb-3">
                <input type="password" className="form-control" id="floatingInput" placeholder="password"></input>
                <label for="floatingInput">Password</label>
            </div>
        </div>
    );
};


export default SignUp;
